import React from 'react';
import styled from "styled-components";


const Projectcard = ({project}) => {
  return (
    <Card>
      <Image src= {project.image}/>
      <Tags></Tags>
      <Details></Details>
      <Members></Members>
    </Card>
  )
}

export default Projectcard;
